import React from 'react';
import { graphql } from '@apollo/client/react/hoc';
import gql from 'graphql-tag';
const title = "tech";
/*const getProductsQuery = gql`
query($input:CategoryInput){
  category(input:$input){
  name
    products{
      id
    }
  }
  }
    `*/
const getProductsQuery = gql`query($input:CategoryInput){
    category(input:$input){
    name
      products{
        id
      }
    }
    }
  `;
/*client.query({
    query: getProductsQuery,
    variables: { input: { "title": title } }
})*/
class Product extends React.Component {
    render() {
        if (this.props.data.loading) {
            return "loading"
        }
        console.log(this.props)
        let products = this.props.data.category.products.map(
            <li className="product__link">
            el => el.id
            </li>
        );
        return (

            { products }

        );
    }
};

export default graphql(getProductsQuery, { input: { "title": "tech" } })(Product);
